import React from "react";

const About = () => {
  return (
    <section id="about" style={{ padding: "65px", textAlign: "center" }}>
      <h2>Tentang Saya</h2>
      <p>Saya seorang Software Engineer dengan pengalaman di pengembangan web dan mobile.</p>
    </section>
  );
};

export default About;
